import React, { Component } from 'react';
import './App.css';
// import DataList from './../dataList'

class BudgetComponent extends Component {
  constructor (props) {
    super(props)
    this.state = {
      response: '',
      post: '',
      responseToPost: '',
      keyword: ''
    }
  }

  render() {
    return (
      <div className="budget-container">
        Hello
      </div>
    );
  }
}

export default BudgetComponent
